import {BrowserRouter,Route,Routes}from 'react-router-dom'

//stranice i komponente

import Home from './pages/Home';
import Navnar from './components/navbar';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Navnar ></Navnar>
      <div className='pages'>
        <Routes>
          <Route
          path='/h'
          element={<Home></Home>}
            />

        </Routes>

      </div>
      </BrowserRouter>
    </div>
  );
}

export default App;
